The '''Culinaromancer's Chest''' is a special chest accessible to players during and after the [[Recipe for Disaster]] [[quest]]. It is located in [[Lumbridge Castle]]'s cellar but is invisible until the player first enters the dining hall and gains access to the multiple subquests. It has a [[bank]], a [[food store]] that sells items for the [[Cooking]] skill, and a combat item store. The combat store sells [[metal gloves]] that act as armour and give offensive bonuses and [[Kitchen weaponry]] utensils which act as analogues to increasingly powerful weapons.

As the player progresses through the quest, greater access to the chest is granted, with more items of food, better gloves, and more powerful utensils available for purchase.

After completing the [[Elite Lumbridge & Draynor Diary]], all items in the Chest are discounted by 20%.

